class ETree {

	private ENode root;
	private String input;
	
	public ETree(String input) {
		this.input = input;
	}
	
	public void parser(){
		root = parserHelper(0);
	}
	
	public void printTree(){
		List<Integer> levellist = new ArrayList<Integer>();
		printHelper(root, -1, levellist, 0, -1,false);
	}
	
	private void printHelper(ENode node, int isAND, List<Integer> levellist, int curlevel, int prevlevel,boolean remove){
		if(null == node){
			return;
		}
		
		if(isAND==1 && (node.value).equals("AND")){
			printHelper(node.left, 1, levellist,curlevel,prevlevel,remove);
			printHelper(node.right, 1, levellist,curlevel,prevlevel,remove);
			return;
		}
		if(isAND==0 && (node.value).equals("OR")){
			printHelper(node.left, 0, levellist,curlevel,prevlevel,remove);
			printHelper(node.right, 0, levellist,curlevel,prevlevel,remove);
			return;
		}
		//
		StringBuilder sb = new StringBuilder();
		if(!levellist.isEmpty()){
			int max = levellist.get(levellist.size()-1);
			if(max==0){
				sb.append(" ");
			}else{
				sb.append(" ");
				if(levellist.contains(0)){
					sb.append("|");
				}else{
					sb.append(" ");
				}
				for(int i=1;i<=max;i++){
					sb.append("  ");
					if(i!=max){
						if(levellist.contains(i)){
							sb.append("|");
						}else{
							sb.append(" ");
						}
					}
				}
			}
		}
		//
		if(prevlevel==-1){
			sb.append(node.value);
			System.out.println(sb.toString());
		}else{
			String temp = sb.toString();
			sb.append("+-");
			sb.append(node.value);
			System.out.println(temp+"|");
			System.out.println(sb.toString());
		}
		List<Integer> newlist1 = getLevelList(levellist);
		List<Integer> newlist2 = getLevelList(levellist);
		if((node.value).equals("AND") || (node.value).equals("OR")){
			newlist1.add(curlevel);
			newlist2.add(curlevel);
			if(remove == true){
				newlist1.remove(new Integer(prevlevel));
				newlist2.remove(new Integer(prevlevel));
			}
			int isand = ((node.value).equals("AND"))?1:0;
			printHelper(node.left, isand, newlist1, curlevel+1, curlevel,false);
			printHelper(node.right, isand, newlist2, curlevel+1, curlevel,true);
		}
	}
	
	private List<Integer> getLevelList(List<Integer> levellist) {
		List<Integer> newlist = new ArrayList<Integer>();
		for(Integer e : levellist){
			newlist.add(e);
		}
		return newlist;
	}

	private ENode parserHelper(int index){
		
		int lbindex = input.indexOf('(', index);
		int cbindex = input.indexOf(')', index);
		int cindex = input.indexOf(',', index);
		if(lbindex == -1 || cbindex < lbindex || cindex < lbindex){
			if(cindex>0 && cindex < cbindex){
				ENode leftnode = new ENode(input.substring(index,cindex));
				leftnode.endIndex = cindex;
				return leftnode;
			}else{
				ENode rightnode = new ENode(input.substring(index,cbindex));
				rightnode.endIndex = cbindex;
				return rightnode;
			}
		}
		
		ENode node = new ENode(input.substring(index,lbindex));
		node.left = parserHelper(lbindex+1);
		node.right = parserHelper(node.left.endIndex+1);
		node.endIndex = node.right.endIndex+1;
		return node;
	}
	
	public void preorder(){
		preorderHelper(root);
	}
	
	private void preorderHelper(ENode node){
		if(node == null){
			return;
		}
		System.out.println(node.value);
		preorderHelper(node.left);
		preorderHelper(node.right);
	}
	
	
}



class ENode {
	
	String value;
	ENode left;
	ENode right;
	int endIndex;
	
	ENode(String value){
		this.value = value;
	}
	
}
